MathJax.Localization.addTranslation("sk","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax pou\u017E\xEDva k zobrazeniu matematiky na tejto str\xE1nke webov\xE9 p\xEDsma. T\xFDm trv\xE1 stiahnutie nejak\xFA dobu, tak\u017Ee str\xE1nka by sa vykreslila r\xFDchlej\u0161ie, ak by ste si tieto matematick\xE9 p\xEDsma nain\u0161talovali priamo do syst\xE9movej zlo\u017Eky p\xEDsiem.",imageFonts:"MathJax pou\u017E\xEDva namiesto miestnych alebo webov\xFDch p\xEDsiem obr\xE1zkov\xE9 p\xEDsmo. Preto bude vykres\u013Eovanie pomal\u0161ie ako je obvykl\xE9 a pri tla\u010Di na Va\u0161ej tla\u010Diarni mo\u017Eno nebude matematika vykreslen\xE1 v najlep\u0161om rozl\xED\u0161en\xED.",noFonts:"MathJax nedok\xE1\u017Ee n\xE1js\u0165 p\xEDsmo, ktor\xFDm by vykreslil matematiku, a obr\xE1zkov\xE9 p\xEDsma nie s\xFA k dispoz\xEDcii, tak\u017Ee sa bude pou\u017E\xEDva\u0165 be\u017En\xE9 znaky Unicode v n\xE1deji, \u017Ee ich v\xE1\u0161 prehliada\u010D dok\xE1\u017Ee zobrazi\u0165. Niektor\xE9 znaky sa mo\u017Eno nezobrazia spr\xE1vne alebo dokonca v\xF4bec.",webFonts:"V\xE4\u010D\u0161ina modern\xFDch prehliada\u010Dov umo\u017E\u0148uje stiahnutie p\xEDsiem cez web. Aktualiz\xE1cia na nov\u0161iu verziu prehliada\u010Da (alebo zmena prehliada\u010Da) by mohla zlep\u0161i\u0165 zobrazenie matematiky na tejto str\xE1nke.",fonts:"MathJax m\xF4\u017Ee pou\u017E\xEDva\u0165 bu\u010F [p\xEDsma STIX](%1) alebo [MathJaxov\xE9 TeXov\xE9 p\xEDsma](%2). Stiahnite a nain\u0161talujte si jedny z nich, aby ste si MathJax u\u017Eili lep\u0161ie.",STIXPage:"Tato str\xE1nka je vytvoren\xE1 na pou\u017Eitie s [p\xEDsmami STIX](%1). Stiahnite a nain\u0161talujte si tieto p\xEDsma, aby ste si lep\u0161ie u\u017Eili MathJax.",TeXPage:"Tato str\xE1nka je vytvoren\xE1 na pou\u017Eitie s [MathJaxov\xFDmi TeXov\xFDmi p\xEDsmy](%1). Pre lep\u0161ie vyu\u017E\xEDvanie MathJaxu si stiahnite a nain\u0161talujte tieto p\xEDsma."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/sk/FontWarnings.js");
